// src/App.js
import React from 'react';
import Navbar from './components/Navbar';
import InterpolPage from './components/InterpolPage'; 
import FbiPage from './components/FbiPage';
import HomePage from './components/HomePage';
import LoginComponent from './components/LoginComponent';
import PrivateRoute from './components/PrivateRoute'; // Importe o PrivateRoute
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <>
        <Navbar />
        <div className="row mt-3">
          <div className="col" id="wanted-persons">
            <Routes>
              <Route path="/login" element={<LoginComponent />} />
              <PrivateRoute path="/fbi" element={<FbiPage />} /> {/* Use PrivateRoute aqui */}
              <PrivateRoute path="/interpol" element={<InterpolPage />} /> {/* E aqui */}
              <Route path="/" element={<HomePage />} />
            </Routes>
          </div>
        </div>
      </>
    </Router>
  );
};

export default App;
